import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter } from 'react-router-dom';  // This should be used once at the top level
import App from './App';
import './index.css';  // Import Tailwind CSS file

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter>  {/* Only wrap the app once here */}
    <App />
  </BrowserRouter>
);
